import React, {useState} from 'react';
import './App.css';

function Card (num, suit){
  this.num = num;
  this.suit = suit;
}

const generateDeck = () => {
  const newDeck = new Set();
  const suits = ["♦", "♥", "♣", "♠"];
  for(const suit of suits){
    for(let i = 1; i <= 13; i++){
      const curCard = new Card(i, suit);
      newDeck.add(curCard);
    }
  }
  return newDeck;
}


function App() {

  const [deck, setDeck] = useState(generateDeck());
  console.log(deck);

  return (
    <div className="App">
      <h1>Deck of Cards</h1>

    </div>
  );
}

export default App;
